import {BrowserRouter as  Router , Routes, Route} from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.css';
import Navbar from './components/Navbar';
impo

function App() {
  return (
   <Router>
    <div>
        <Navbar/>
        <Routes>
          <Route path='/' element={<Home/>}/>
        </Routes>
    </div>
   </Router>
  );
}

export default App;
